import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import '../styles/EmotionsDiary.css';

function DiarioEmociones() {
  const navigate = useNavigate();
  const [timeMachineResult, setTimeMachineResult] = useState(null);
  // Almacena las calificaciones: clave √∫nica (slot-activityId) -> rating (1 a 5)
  const [ratings, setRatings] = useState({});

  // Verificar token: si no existe, redirigir al login.
  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/');
    }
  }, [navigate]);

  // Recupera el √∫ltimo resultado de la M√°quina del Tiempo
  useEffect(() => {
    const fetchResult = async () => {
      try {
        const token = localStorage.getItem('token');
        const res = await axios.get('http://localhost:5000/api/game', {
          headers: { 'x-auth-token': token }
        });
        if (res.data && res.data.length > 0) {
          // Usamos el resultado m√°s reciente
          setTimeMachineResult(res.data[0]);
        }
      } catch (err) {
        console.error(err);
      }
    };
    fetchResult();
  }, []);

  // Maneja el clic en una emoci√≥n para una actividad
  const handleRating = (uniqueId, ratingValue) => {
    setRatings(prev => ({ ...prev, [uniqueId]: ratingValue }));
  };

  // Renderiza el control de calificaci√≥n con 5 botones (emojis)
  const renderRatingControl = (uniqueId) => {
    const currentRating = ratings[uniqueId] || 0;
    // Definimos 5 niveles de satisfacci√≥n:
    // 1: nada feliz, 2: poco feliz, 3: neutral, 4: feliz, 5: muy feliz
    const emojis = ['‚òπÔ∏è', 'üòï', 'üòê', 'üòä', 'üòÅ'];
    return (
      <div className="rating-control">
        {emojis.map((emoji, index) => {
          const value = index + 1;
          return (
            <button
              key={value}
              className={`rating-btn ${currentRating === value ? 'selected' : ''}`}
              onClick={() => handleRating(uniqueId, value)}
            >
              {emoji}
            </button>
          );
        })}
      </div>
    );
  };

  // Guarda el diario de emociones enviando las calificaciones al backend
  const handleSaveDiary = async () => {
    const token = localStorage.getItem('token');
    // Recorre el resultado de la M√°quina del Tiempo y genera un array de calificaciones.
    let ratingArray = [];
    if (timeMachineResult && timeMachineResult.timeSlots) {
      timeMachineResult.timeSlots.forEach(slot => {
        slot.activities.forEach(activity => {
          // Usamos como clave √∫nica la combinaci√≥n del slot y el activityId.
          const uniqueId = `${slot.slot}-${activity.activityId}`;
          const ratingValue = ratings[uniqueId];
          if (ratingValue) {
            ratingArray.push({
              activityId: activity.activityId,
              title: activity.title,
              icon: activity.icon,
              rating: ratingValue
            });
          }
        });
      });
    }
    if (ratingArray.length === 0) {
      alert('Por favor, califica al menos una actividad.');
      return;
    }
    try {
      await axios.post(
        'http://localhost:5000/api/diarioEmociones',
        { ratings: ratingArray },
        { headers: { 'x-auth-token': token } }
      );
      alert('¬°Diario de emociones guardado!');
      navigate('/dashboard');
    } catch (err) {
      console.error(err);
      alert('Error al guardar el diario.');
    }
  };

  return (
    <div className="diario-emociones-container">
      <header className="de-header">
        <button className="back-btn" onClick={() => navigate('/dashboard')}>‚Üê</button>
        <h1>Diario de Emociones</h1>
      </header>

      <div className="de-instructions">
        <p>¬øC√≥mo te sientes con lo bien que haces estas actividades?</p>
      </div>

      <main className="de-main">
        {timeMachineResult ? (
          <div className="activities-container">
            {timeMachineResult.timeSlots.map(slot =>
              slot.activities.map(activity => {
                const uniqueId = `${slot.slot}-${activity.activityId}`;
                return (
                  <div key={uniqueId} className="activity-card">
                    <div className="activity-info">
                      <span className="activity-icon">{activity.icon}</span>
                      <span className="activity-title">{activity.title}</span>
                    </div>
                    {renderRatingControl(uniqueId)}
                  </div>
                );
              })
            )}
          </div>
        ) : (
          <p>No hay datos de Rutinas y Tiempo para calificar.</p>
        )}
      </main>

      <div className="de-actions">
        <button className="save-diary-btn" onClick={handleSaveDiary}>Guardar mis emociones</button>
      </div>

      <footer className="footer-bar">
        <p>2025 ¬© Iv√°n Vela Campos</p>
      </footer>
    </div>
  );
}

export default DiarioEmociones;
